import { Injectable } from '@angular/core';
import { select, Store } from '@ngrx/store';
import { State } from '@store/.';
import { addError, clearError } from '@store/global-error/actions/global-error.actions';
import { globalErrorState } from '@store/global-error/reducers/global-error-service.reducer';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class GlobalErrorService {
  private errors: Observable<GlobalError[]>;

  constructor(private store: Store<State>) {
    this.errors = this.store.pipe(select(globalErrorState));
  }

  get errors$() {
    return this.errors;
  }

  addError(error: GlobalError) {
    this.store.dispatch(addError(error));
  }

  clearError(): void {
    this.store.dispatch(clearError());
  }
}

export interface GlobalError {
  error: string;
  anchorLink?: string;
}

import { createFeatureSelector, createReducer, createSelector, on } from '@ngrx/store';
import * as TechnicalRecordServiceActions from '../../technical-records/technical-record-service.actions';
import * as TestResultActions from '@store/test-records';
import * as GlobalErrorActions from '../actions/global-error.actions'
import { GlobalError } from 'src/app/features/global-error/global-error.service';

export const STORE_GLOBAL_ERROR_KEY = 'GlobalError';

export interface GlobalErrorState {
  globalError: Array<GlobalError>;
}

export const initialGlobalErrorState: GlobalErrorState = {
  globalError: []
};

export const getGlobalErrorState = createFeatureSelector<GlobalErrorState>(STORE_GLOBAL_ERROR_KEY);

export const globalErrorState = createSelector(getGlobalErrorState, (state) => state.globalError);

export const globalErrorReducer = createReducer(
  initialGlobalErrorState,
  on(GlobalErrorActions.clearError, TechnicalRecordServiceActions.getByVIN, TestResultActions.fetchTestResults, TestResultActions.fetchTestResultsBySystemId, (state) => ({ ...state, globalError: [] })),
  on(GlobalErrorActions.addError, TechnicalRecordServiceActions.getByVINFailure, TestResultActions.fetchTestResultsFailed, TestResultActions.fetchTestResultsBySystemIdFailed, (state, {error, anchorLink}) => ({...state, globalError: [...state.globalError, {error: error, anchorLink: anchorLink}]}))
);

import { CommonModule } from '@angular/common';
import { HTTP_INTERCEPTORS } from '@angular/common/http';
import { InjectionToken, ModuleWithProviders, NgModule, Optional, SkipSelf } from '@angular/core';
import { DelayedRetryInterceptor } from './delayed-retry.interceptor';

export const HTTP_RETRY_CONFIG = new InjectionToken<HttpRetryConfig>('HttpRetryConfig');

export interface HttpRetryConfig {
  /**
   * The maximum number of times to retry.
   */
  count?: number;
  /**
   * The number of milliseconds to delay before retrying.
   */
  delay?: number;
  /**
   * Array of http status codes to retry. If undefined, all requests are retried.
   */
  httpStatusRetry?: Array<number>;
  /**
   * If true, each retry delay will be multiplied by the current retry count.
   */
  backoff?: boolean;
}

@NgModule({
  declarations: [],
  imports: [CommonModule],
  providers: [
    {
      provide: HTTP_INTERCEPTORS,
      useClass: DelayedRetryInterceptor,
      multi: true
    }
  ]
})
export class DelayedRetryModule {
  constructor(@Optional() @SkipSelf() parentModule?: DelayedRetryModule) {
    if (parentModule) {
      throw new Error('DelayedRetryModule is already loaded. Import it in the AppModule only');
    }
  }

  static forRoot(config?: HttpRetryConfig): ModuleWithProviders<DelayedRetryModule> {
    return {
      ngModule: DelayedRetryModule,
      providers: [{ provide: HTTP_RETRY_CONFIG, useValue: config }]
    };
  }
}

import { HttpEvent, HttpHandler, HttpInterceptor, HttpRequest } from '@angular/common/http';
import { Inject, Injectable, Optional } from '@angular/core';
import { Observable, retry, timer } from 'rxjs';
import { HttpRetryConfig, HTTP_RETRY_CONFIG } from './delayed-retry.module';

interface InternalConfig extends Required<Pick<HttpRetryConfig, 'count' | 'delay' | 'backoff'>>, Pick<HttpRetryConfig, 'httpStatusRetry'> {}

@Injectable()
export class DelayedRetryInterceptor implements HttpInterceptor {
  config: InternalConfig;

  private readonly defaultConfig = { count: 3, delay: 2000, backoff: false };

  constructor(@Optional() @Inject(HTTP_RETRY_CONFIG) private config_: HttpRetryConfig) {
    this.config = { ...this.defaultConfig, ...this.config_ };
  }

  intercept(request: HttpRequest<unknown>, next: HttpHandler): Observable<HttpEvent<unknown>> {
    return next.handle(request).pipe(
      retry({
        delay: (error: any, retryCount: number) => this.retryHandler(error, retryCount, this.config)
      })
    );
  }

  retryHandler(error: any, retryCount: number, config: InternalConfig) {
    const { delay, count, httpStatusRetry, backoff } = config;
    const { status } = error;

    if (httpStatusRetry && !httpStatusRetry.includes(status)) {
      throw error;
    }

    if (retryCount >= count) {
      throw 'Request timed out. Check connectivity and try again.';
    }

    return timer(backoff ? delay * retryCount : delay);
  }
}

