    component: RadioGroupComponent,
    template: `<form [formGroup]="form"><app-radio-group [label]="label" [hint]="hint" [name]="name" [options]="options" [formControlName]="name"></app-radio-group></form> <pre>{{ form.value | json }}</pre>`,
    props: {
      form,
      label,
      name,
      options,
      hint
    }
  };
}

